function Root() {
    const [currentlyPlaying, setCurrentlyPlaying] = useState(null);

    const handlePlay = (id) => {
        setCurrentlyPlaying(id); // Update the currently playing video
    };

    return (
        <BrowserRouter>
            <div id="view">
                <h1>Video Gallery</h1>
                <h2>Travel</h2>
                <DriveVideoEmbed
                    videoUrl="https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview" 
                    // width="15vw" 
                    // height="26.6666666666vw"
                    playing={currentlyPlaying === 1}
                    onPlay={() => handlePlay(1)}
                />
                <DriveVideoEmbed
                    videoUrl="https://drive.google.com/file/d/13H-UJ-M6Qsi4zWdyOWGQSnMg0JZA-WN2/preview"
                    // height="15vw" width="26.6666666666vw"
                    playing={currentlyPlaying === 2}
                    onPlay={() => handlePlay(2)}
                />
            </div>
        </BrowserRouter>
    );
}

const rootElement = document.getElementById("root");
